		private static Instruction Decode_00(IByteReader r, ref byte b0, ref byte b1)
		{
			switch (b1 = r.ReadOne())
			{
				case 0x00: return I.Word(); // 0x0000;
				case 0x01: return I.Word(); // 0x0001;
				case 0x02: return I.Stc(); // sr,r0;
				case 0x03: return I.Bsrf(); // r0;
				case 0x04: return I.Mov_b(); // r0,@(r0,r0);
				case 0x05: return I.Mov_w(); // r0,@(r0,r0);
				case 0x06: return I.Mov_l(); // r0,@(r0,r0);
				case 0x07: return I.Mul_l(); // r0,r0;
