				case 0x0d: return I.Mov_w(); // @(r0,r0),r0;
				case 0x0e: return I.Mov_l(); // @(r0,r0),r0;
				case 0x0f: return I.Mac_l(); // @r0+,@r0+;
				case 0x10: return I.Word(); // 0x0010;
				case 0x11: return I.Word(); // 0x0011;
				case 0x12: return I.Stc(); // gbr,r0;
				case 0x13: return I.Word(); // 0x0013;
				case 0x14: return I.Mov_b(); // r1,@(r0,r0);
				case 0x15: return I.Mov_w(); // r1,@(r0,r0);
				case 0x16: return I.Mov_l(); // r1,@(r0,r0);
				case 0x17: return I.Mul_l(); // r1,r0;
				case 0x18: return I.Sett(); // ;
				case 0x19: return I.Div0u(); // ;
				case 0x1a: return I.Sts(); // macl,r0;
				case 0x1b: return I.Sleep(); // ;
				case 0x1c: return I.Mov_b(); // @(r0,r1),r0;
				case 0x1d: return I.Mov_w(); // @(r0,r1),r0;
				case 0x1e: return I.Mov_l(); // @(r0,r1),r0;
				case 0x1f: return I.Mac_l(); // @r1+,@r0+;
				case 0x20: return I.Word(); // 0x0020;
				case 0x21: return I.Word(); // 0x0021;
				case 0x22: return I.Stc(); // vbr,r0;
				case 0x23: return I.Braf(); // r0;
				case 0x24: return I.Mov_b(); // r2,@(r0,r0);
				case 0x25: return I.Mov_w(); // r2,@(r0,r0);
				case 0x26: return I.Mov_l(); // r2,@(r0,r0);
