				case 0x2a: return I.Sts(); // pr,r0;
				case 0x2b: return I.Rte(); // ;
				case 0x2c: return I.Mov_b(); // @(r0,r2),r0;
				case 0x2d: return I.Mov_w(); // @(r0,r2),r0;
				case 0x2e: return I.Mov_l(); // @(r0,r2),r0;
				case 0x2f: return I.Mac_l(); // @r2+,@r0+;
				case 0x30: return I.Word(); // 0x0030;
				case 0x31: return I.Word(); // 0x0031;
				case 0x32: return I.Word(); // 0x0032;
				case 0x33: return I.Word(); // 0x0033;
